import { TextField, MenuItem, InputAdornment, Button} from '@material-ui/core'
import Grid from '@material-ui/core/Grid'

export default function MeetFirstStep({label, register}){


    const tipoConsultas=[
        "Vacuna",
        "Control",
        "Pelea con otra rata",
        "Depresion",
        "Celos"
    ]

    return(
        <>
            <Grid container spacing={2} noValidate>
                <TextField
                name="consulta"
                inputRef={(ref)=>{
                    if(!ref) return;
                    register({name:"tipo", value: ref.value})
                }}
                fullWidth
                id="tipo"
                select
                label="Tipo de medicamento.."
                helperText="Por favor selecciona el tipo de medicamento"
                >
                {tipoConsultas.map((tipo) => (
                    <MenuItem key={tipo} value={tipo}>
                        {tipo}
                    </MenuItem>
                ))}
                </TextField>
            </Grid>
        </>
    )
}
